$(function(){$("a[href*=#],area[href*=#]").click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var a=$(this.hash);if(a=a.length&&a||$("[name="+this.hash.slice(1)+"]"),a.length){var t=a.offset().top-90;return $("html,body").stop().animate({scrollTop:t},1e3),!1}}})});